        Q2(:,2).*Q1(:,2),...
        Q2(:,2).*Q1(:,3),...
        Q2(:,3).*Q1(:,1),...
        Q2(:,3).*Q1(:,2),...
        Q2(:,3).*Q1(:,3),...
